import React from 'react';
import Bio from '../components/Bio';
import ChrissyImg from './../images/ChristinaMurray.jpeg'

const Team = () => (
  <div className="biocard">
    <Bio 
      name="Dr. Christina Murray, O.D." role="Doctor" 
      bio="Dr. Murray is originally from Columbus, Ohio, and is a proud graduate of The Ohio State University. She happily escaped the cold Ohio winters to attend ..." 
      url='https://da4e1j5r7gw87.cloudfront.net/wp-content/uploads/sites/422/2018/04/UKKXIPXYVTEA.IMAGE_4.jpeg' />
  </div>
);

export default Team;
